import "./Home.css";
import Logo from "../Logo/Logo";

function Home() {
  return (
      <>
      <section>
        <Logo />
        <h1 className="menu-heading">Menu</h1>
      </section>
      <section style={{backgroundColor: "blue", margin: "10px"}}>
        <div>
            <h1>Pancake</h1>
        </div>
      </section>
      <section style={{backgroundColor: "green"}}>
        <Logo />
        <h1 className="menu-heading">Menu</h1>

      </section>
      </>
  );
}

export default Home;
